import { FC } from 'react';
import Layout from '../components/Layout';
import SignupComponents from '../components/auth/SignupComponents';

const Signup:FC = () => {
  return (
    <Layout>
      <h2>Signup page</h2>
      <SignupComponents />
    </Layout>
  );
};

export default Signup;
